" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Syndesmosis (interosseous ligament)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 433px; height: 632px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Anterior view of the tibia and fibula. The interosseous ligament is a thick osseofascial membrane that runs the length of the tibia and fibula and terminates distally in the thicker syndesmosis.",
